import React from 'react';

class LateralMenu extends React.Component{
	getStyle = () => {
		return {
			background: '#f4f4f4',
			padding: '10px',
			width: '30%',
			height: '300px'
		}
	}

	render(){
		return(
			<div style={this.getStyle()}>
				<p>Companies</p>
				<p>Usuários</p>
				<p>Resetar Senha</p>
				<p>Simulação</p>
			</div>
		);
	}
}

export default LateralMenu;
